dk.seges.1_1.models.SEPTORIAHU.description=KASVINTUHOOJA: Vehnän lehtilaikkutaudit voivat johtua harmaalaikusta (Zymoseptoria tritici) ja ruskolaikusta (Parastagonospora nodorum), joita molempia suosivat kosteat olosuhteet.\nPÄÄTÖS: Fungisidikäsittelyjä voidaan tarvita korrenkasvun ja tähkimisen välillä, pääasiassa ylälehtien suojaamiseksi.\nMALLI: Kasvuaste GS 31:n säätietoja käytetään. Kosteusmalli arvioi harmaalaikkutartuntojen riskiä syysvehnässä. Tartuntariski on 20 tunnin jatkuvan kosteuden jälkeen. Kostean tunnin määritys: vähintään 0,2 mm sadetta tunnissa tai vähintään 85 % suhteellinen kosteus.\nPARAMETRIT: Tärkeimpien kasvuasteiden päivämäärät annetaan oletusarvoina, mutta ne eivät välttämättä ole oikein. Tarkkojen riskiennusteiden saamiseksi on välttämätöntä napsauttaa Muokkaa parametreja -painiketta ja syöttää arvioidut päivämäärät: GS31 (ensimmäinen havaittavissa oleva solmu), GS32 (toinen solmu; kolmanneksi ylin lehti avautumassa), GS33 (kolmas solmu; toiseksi ylin lehti avautumassa) ), GS37/39 (lippulehtivaihe) ja GS75 (maitotuleentumisvaihe), napsauta sitten Tallenna-painiketta. Näitä arvioituja päivämääriä voidaan päivittää kauden aikana, kun kasvuasteet saavutetaan. Tietojen lisääminen fungisidien ruiskutuspäivämääristä on mallin kannalta elintärkeää. Tämä tehdään myös kohdassa "Muokkaa parametreja". Napsauttamalla 'Tallenna' ruiskutuspäivämäärät tallentuvat. Ruiskutuksen jälkeen malli olettaa, että kasvusto on suojattu 10 päivää.\nLÄHDE: Aarhus Universityn ja SEGESin luoma ja julkaistu Tanskassa vuonna 2017. Testattu Liettuassa, Norjassa, Ruotsissa, Suomessa ja Tanskassa vuosina 2018 ja 2019.\nOLETUKSET: Harmaalaikkua esiintyy kasvustossa ja korkean kosteuden jaksot aiheuttavat vahingollisen epidemian
